                  Box 739","FacilityStreetAddress2":"","FacilityStreetAddress3":"","LastUpdatedDate":"2023-01-10","PostalCode":"97754"}],"FacilityAdaAccess":"N","FacilityDescription":"<h2>Overview</h2>\nHaystack
                  Campground (East Shore) is located in central Oregon''s scenic Crooked River
                  National Grassland.  With a view of Mt. Jefferson in the distance, visitors
                  can enjoy the beautiful vistas while relaxing in the high desert.<h2>Recreation</h2>\nFishing
                  is a popular pastime at the reservoir, which is regularly stocked.  Largemouth
                  bass, rainbow trout, kokanee, along with crappie and catfish are some of the
                  species that inhabit the water.  Recreational boating is also popular with
                  paved boat ramps available at Haystack Campground as well as at the West Shore
                  Campground.  Swimming is also permitted. \n<br/>\nNearby areas provide other
                  activities such as rock climbing, hiking, horseback riding, mountain biking,
                  and ATV use.<h2>Facilities</h2>\nHaystack Campground offers 24 spacious campsites
                  that will accommodate tents to large RVs.  It is located on the east shore
                  of Haystack Reservoir and has paved interior roads and site pads.  Each campsite
                  has a picnic table and campfire ring. There are five vault toilets conveniently
                  located throughout the campground. Potable water is available at the RV fill
                  station located just past the entrance station. <br/>\n<br/>\nIn addition
                  to the individual campsites, there are Day Use areas that have covered picnic
                  tables.  <h2>Natural Features</h2>\nNear Madras, Oregon, Haystack Reservoir''s
                  240 surface-acres are surrounded by a high desert landscape of juniper trees
                  and sagebrush.\n<br/>\nThe expanse of water attracts waterfowl such as common
                  loon, horned grebe, red-necked grebe, and eared grebe for a respite during
                  migration. Rarities that have been reported are trumpeter swan, surf scoter,
                  black-necked stilt, sanderling, bald eagle, osprey, and eastern kingbird.
                  The spring breeding season in April through May produces nature''s own concert
                  from Pacific chorus frog. \n<h2>Nearby Attractions</h2>\nSmith Rock State
                  Park, a very popular area for rock climbing is about a 20-minute drive to
                  the south.  Also, a spectacular view of the Crooked River Gorge is available
                  from an old highway bridge, now accessible by a short walk from a rest area
                  just off Hwy 97 about 15 minutes south of the campground.","FacilityDirections":"From
